// Search.jsx
import './Search.css';
import React, { useState } from "react";

export default function Search({ setResults, setRecipientLocation, setUserHasSearched }) {
  const [bloodType, setBloodType] = useState("");
  const [rangeKm, setRangeKm] = useState(5);

  const haversine = (lat1, lon1, lat2, lon2) => {
    const R = 6371;
    const dLat = (lat2 - lat1) * Math.PI / 180;
    const dLon = (lon2 - lon1) * Math.PI / 180;
    const a =
      Math.sin(dLat / 2) ** 2 +
      Math.cos(lat1 * Math.PI / 180) *
        Math.cos(lat2 * Math.PI / 180) *
        Math.sin(dLon / 2) ** 2;
    return R * 2 * Math.asin(Math.sqrt(a));
  };

  const handleSearch = () => {
    if (!bloodType) return alert("Select blood type");

    navigator.geolocation.getCurrentPosition(
      (pos) => {
        const lat = Number(pos.coords.latitude);
        const lng = Number(pos.coords.longitude);

        setRecipientLocation({ lat, lng });

        const donors = JSON.parse(localStorage.getItem("registeredUsers")) || [];

        const filtered = donors.filter((d) => {
          const dLat = Number(d.location.latitude);
          const dLng = Number(d.location.longitude);
          const matchesType =
            (d.bloodType || d.bloodGroup)?.toUpperCase() === bloodType.toUpperCase();

          if (!matchesType) return false;

          const dist = haversine(lat, lng, dLat, dLng);
          return dist <= rangeKm;
        });

        setResults(filtered);
        setUserHasSearched(true);
      },
      (err) => {
        console.log("Geolocation error:", err);
      }
    );
  };

  return (
    <section className="search-section">
      <div className="container">
        <h2 className="title">Find Blood Donors</h2>

        <form
          className="search-form"
          onSubmit={(e) => {
            e.preventDefault();
            handleSearch();
          }}
        >
          <div className="form-group">
            <label>Blood Type Needed</label>
            <select value={bloodType} onChange={(e) => setBloodType(e.target.value)}>
              <option value="">Select Blood Group</option>
              <option value="A+">A+</option><option value="A-">A-</option>
              <option value="B+">B+</option><option value="B-">B-</option>
              <option value="AB+">AB+</option><option value="AB-">AB-</option>
              <option value="O+">O+</option><option value="O-">O-</option>
            </select>
          </div>

          <div className="form-group">
            <label>Search Radius</label>
            <select value={rangeKm} onChange={(e) => setRangeKm(Number(e.target.value))}>
              <option value={5}>5 km</option>
              <option value={10}>10 km</option>
              <option value={20}>20 km</option>
              <option value={30}>30 km</option>
            </select>
          </div>

          <button type="submit" className="search-section-button">Search Donors</button>
        </form>
      </div>
    </section>
  );
}
